import React, { useState } from "react";

const LoginSignup = () => {
  const [isLogin, setIsLogin] = useState(true);

  const handleToggle = () => setIsLogin((prev) => !prev);

  return (
    <div style={styles.container}>
      <div
        style={{
          ...styles.formContainer,
          transform: isLogin ? "translateX(0)" : "translateX(-100%)",
        }}
      >
        {/* Login Form */}
        <div style={styles.form}>
          <h2 style={styles.heading}>Welcome Back!</h2>
          <p style={styles.subText}>Please login to your account</p>
          <input type="email" placeholder="Email Address" style={styles.input} />
          <input type="password" placeholder="Password" style={styles.input} />
          <button style={styles.button}>Login</button>
          <p style={styles.switchText}>
            Don't have an account?{" "}
            <span style={styles.link} onClick={handleToggle}>
              Sign Up
            </span>
          </p>
        </div>

        {/* Signup Form */}
        <div style={styles.form}>
          <h2 style={styles.heading}>Create an Account</h2>
          <p style={styles.subText}>Join us for an amazing experience</p>
          <input type="text" placeholder="Full Name" style={styles.input} />
          <input type="email" placeholder="Email Address" style={styles.input} />
          <input type="password" placeholder="Password" style={styles.input} />
          <input
            type="password"
            placeholder="Confirm Password"
            style={styles.input}
          />
          <button style={styles.button}>Sign Up</button>
          <p style={styles.switchText}>
            Already have an account?{" "}
            <span style={styles.link} onClick={handleToggle}>
              Login
            </span>
          </p>
        </div>
      </div>

      {/* Animation Overlay */}
      <div style={styles.overlay}>
        <div
          style={{
            ...styles.overlayContent,
            left: isLogin ? "50%" : "-50%",
            transition: "all 0.6s ease-in-out",
          }}
        >
          <h1 style={styles.overlayText}>
            {isLogin ? "Hello, Friend!" : "Welcome Back!"}
          </h1>
          <p style={styles.overlaySubText}>
            {isLogin
              ? "Enter your details to start your journey with us."
              : "Login to continue your adventure."}
          </p>
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    position: "relative",
    width: "100%",
    height: "100vh",
    overflow: "hidden",
    fontFamily: "'Arial', sans-serif",
    background: "linear-gradient(135deg, #74ebd5, #acb6e5)",
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
  },
  formContainer: {
    display: "flex",
    width: "200%",
    height: "70%",
    transition: "transform 0.6s ease-in-out",
  },
  form: {
    width: "50%",
    padding: "2rem",
    backgroundColor: "#fff",
    borderRadius: "10px",
    boxShadow: "0 10px 30px rgba(0, 0, 0, 0.2)",
    display: "flex",
    flexDirection: "column",
    alignItems: "center",
    justifyContent: "center",
    transform: "translateZ(0)",
    animation: "fadeIn 1s ease-in-out",
  },
  heading: {
    fontSize: "2rem",
    marginBottom: "1rem",
    color: "#333",
  },
  subText: {
    fontSize: "1rem",
    color: "#777",
    marginBottom: "2rem",
  },
  input: {
    width: "80%",
    padding: "0.8rem",
    margin: "0.5rem 0",
    borderRadius: "25px",
    border: "1px solid #ccc",
    outline: "none",
    transition: "all 0.3s ease",
  },
  button: {
    width: "80%",
    padding: "0.8rem",
    marginTop: "1rem",
    backgroundColor: "#6a82fb",
    color: "white",
    border: "none",
    borderRadius: "25px",
    cursor: "pointer",
    fontSize: "1rem",
    transition: "background 0.3s ease",
    outline: "none",
  },
  switchText: {
    marginTop: "1rem",
    fontSize: "0.9rem",
    color: "#555",
  },
  link: {
    color: "#6a82fb",
    cursor: "pointer",
    textDecoration: "underline",
  },
  overlay: {
    position: "absolute",
    top: 0,
    left: 0,
    width: "100%",
    height: "100%",
    zIndex: -1,
  },
  overlayContent: {
    position: "absolute",
    top: "50%",
    transform: "translateY(-50%)",
    width: "100%",
    textAlign: "center",
    color: "#fff",
  },
  overlayText: {
    fontSize: "3rem",
    fontWeight: "bold",
    margin: "0 0 1rem 0",
  },
  overlaySubText: {
    fontSize: "1.2rem",
  },
};

export default LoginSignup;
